import React from 'react';
import css from './ProductsList.module.css';

const ProductsList = () => {
  return (
    <div>
      <h1>ProductsList</h1>
      <div>
        <div className={css.productsList}>
          <img src="/assets/budmaterialy.png" alt="" srcset="" />
          <p>Будматеріали</p>
        </div>
        {/* <ul>
          <li>Гіпсокартон</li>
          <li>Ізоляційні матеріали</li>
          <li>Композитні матеріали</li>
          <li>Фарби,лаки,емалі</li>
          <li>Кріплення</li>
          <li>Листові матеріали</li>
          <li>Металочерепиця</li>
          <li>Металопрокат</li>
          <li>Полікарбонат</li>
          <li>Сітки</li>
          <li>Сухі суміші</li>
          <li>Утеплювачі</li>
          <li>Водостосточні системи</li>
          <li>Паркани та комплектуючі</li>
        </ul> */}
      </div>
    </div>
  );
};

export default ProductsList;
